  // Function to render properties dynamically
  function renderProperties(properties) {
    const propertyList = document.getElementById("property-list");
    propertyList.innerHTML = ""; // Clear any previous listings
  
    properties.forEach(property => {
      const propertyCard = document.createElement("div");
      propertyCard.classList.add("property-card");
  
      propertyCard.innerHTML = `
        <img src="${property.image}" alt="${property.title}">
        <div class="card-content">
          <h3>${property.title}</h3>
          <p>${property.description}</p>
          <div class="location">${property.location}</div>
          <div class="price">${property.price}</div>
        </div>
      `;
  
      propertyList.appendChild(propertyCard);
    });
  }
  
  // Handle search functionality
  document.getElementById("searchForm").addEventListener("submit", function(event) {
    event.preventDefault();
    const searchQuery = document.getElementById("searchInput").value.toLowerCase();
    const filteredProperties = properties.filter(property => 
      property.title.toLowerCase().includes(searchQuery) || 
      property.location.toLowerCase().includes(searchQuery) ||
      property.description.toLowerCase().includes(searchQuery)
    );
  
    renderProperties(filteredProperties);
  });
  
  // Initial render of all properties
  renderProperties(properties);
  